import React from 'react';
import {Card, Button} from 'react-bootstrap';

const Item = (props) => {
  let item = props.item;
  const [imagen, nombre, enStock] = [item.imagen, item.nombre, item.enStock];
  return <>
    <Card className = "col-12 centrado" style={{ width: '12rem'}}>
        <Card.Img className = "row" variant="top" src={imagen} />
        <Card.Body className = "row">
            <Card.Title className = "row">{nombre}</Card.Title>
            <Card.Text className = "row"> {enStock ? 'En stock':'Sin stock'} </Card.Text>
            <Button variant="primary">Ver producto</Button>
        </Card.Body>
    </Card>
  </>;
};

export default Item;
